import { useNavigate } from 'react-router'


function sidebar (){

  const navigate = useNavigate();

  function handleClick(event) {

    navigate('/target-route');
  }

    return(
        <div>
      <div className=" w-full h-full absolute bg-black/20 flex item-center justify-end bottom-1  ">


                <div className="  h-full w-1/3   bg-white p-3  shadow-xl">
                  <div class=' relative h-1/3 rounded-xl  bg-gradient-to-t from-cyan-800 to-cyan-300 shadow-md'>

                      <button type="button" onClick={handleClick} class='ring-1 shadow-md bg-white m-3 rounded-lg'>
                        <ArrowLeftIcon className="h-8 w-8 m-4 font-bold text-2xl" aria-hidden="true" />
                      </button>
                      <img src={dino2} alt="poke" class=" h-full w-full  -bottom-20 absolute  mx-auto"/>
                  </div>

                  <span className="flex justify-center pt-1 text-3xl"> ivysaur</span>





                  </div>

              </div>



    </div>






    )
}
export default sidebar;
